import { useEditId } from "../../Providers/EditContext";

const EditUserQuestion = () => {
    const { editId } = useEditId();
    console.log("EditIdContext:", editId);

    const displayEditId = editId || "No Edit ID available"; // Display a default message if editId is null

    return (
        <div>
            <h1>This is Question</h1>
            <h3>{displayEditId}</h3>
        </div>
    );
};

export default EditUserQuestion;
